import {useState} from 'react'
const AddItem=()=>{
    const [itemform,setitemform]=useState({})
    return <div className="container"> 
    <form className="form-group" >
        <input type="number" placeholder="id" className="form-control" onChange={(e)=>setitemform({...itemform,id:e.target.value})}></input><br></br>
        <input type="text" placeholder="name" className="form-control" onChange={(mye)=>setitemform({...itemform,name:mye.target.value})}></input><br></br>
        <input type="number" placeholder="price" className="form-control" onChange={(event)=>setitemform({...itemform,price:event.target.value})}></input><br></br>
        <input type="text" placeholder="pic" className="form-control" onChange={(g)=>setitemform({...itemform,img:g.target.val})}></input><br></br>
        <input type="submit" className="form-control" value='שלח' ></input>
    </form></div>
}
export default  AddItem;
